There are several ways to terminate a C program:

1. Use the `return` statement: In the `main()` function, you can simply use the `return` statement followed by an integer value to terminate the program. The integer value represents the exit status of the program, where `0` typically indicates successful termination.

```c
int main() {
    // Your code here

    return 0; // Terminate the program
}
```

2. Use the `exit()` function: The `exit()` function is a standard library function that terminates the program. It takes an integer argument representing the exit status.

```c
#include <stdlib.h>

int main() {
    // Your code here

    exit(0); // Terminate the program
}
```

3. Use the `abort()` function: The `abort()` function is another standard library function that terminates the program abruptly. It does not require an exit status argument.

```c
#include <stdlib.h>

int main() {
    // Your code here

    abort(); // Terminate the program abruptly
}
```

Note: It's good practice to clean up any resources (e.g., closing files, freeing memory) before terminating the program.

